document.getElementById('search').addEventListener('input', function() {
    const q = this.value.toLowerCase();
    const lista = document.getElementById('lista');
    lista.innerHTML = "";

    clientes
        .filter(c => c.id.toLowerCase().includes(q) || c.nome.toLowerCase().includes(q))
        .forEach(c => {
            lista.innerHTML += `
                <div class="card">
                    <b>ID:</b> {${c.id}}<br>
                    <b>Nome:</b> {${c.nome}}<br>
                    <b>Local:</b> {${c.local}}
                </div>`;
        });
});
</script>
